import linkedin from './linkedin-logo.png'
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import gmail from './gmail.png'

function SocialNetwork(){
    const theme1 = createTheme({
        typography: {
          fontFamily: [
            '-apple-system',
            'BlinkMacSystemFont',
          '"Segoe UI"',
          'Roboto',
          '"Helvetica Neue"',
          'Arial',
          'sans-serif',
          '"Apple Color Emoji"',
          '"Segoe UI Emoji"',
          '"Segoe UI Symbol"',
          ].join(','),
        },
      });
    return(
        <>
            <div className="row justify-content-center">
                <ThemeProvider theme={theme1}>
                    <Typography variant="h3">You can reach me here :)</Typography>
                </ThemeProvider>
            </div>
            <div className="row">
                <div className='col'>
                    <a href='https://www.linkedin.com/in/mohan-kumar-r/' target="_blank" rel="noopener noreferrer"><img src={linkedin}  style={{width:"10vh"}}></img></a>                 
                </div>
                <div className='col'>
                <a href="https://mail.google.com/mail/u/0/?view=cm&fs=1&tf=1&to=mohankumarr2407@gmail.com" target="_blank" rel="noopener noreferrer"><img src={gmail}  style={{width:"10vh"}}></img></a>
                </div>
              
            </div>
        </>
    );
   
}

export default SocialNetwork;
